import React from 'react'

class SignIn extends React.Component{
   constructor(props){
       super(props);
       this.state={
           isDropDownClicked:false,
           signInEmail:'',
           signInPassword:''
       }
   }
   render(){
   return(
        <div className="signInDD__wrapper">
        <header className="signInDD__header">
            <h2>SignIn</h2>
        </header>
        <ul className="signInDD__list">
            <li className="signInDD__item">
                <label htmlFor="signInEmail">Email</label>
                <input type="text" id="signInEmail"></input>
            </li>
            <li className="signInDD__item">
                <label htmlFor="signInPassword">Email</label>
                <input type="text" id="signInPassword"></input>
            </li>
            <button>Submit</button>
        </ul>

        </div>
    )
   }
}

export default SignIn;
